import { Route, Routes } from 'react-router-dom';
import Start from './pages/Start';
import Beer from './pages/Beer';

function App() {
  return (
    <Routes>
          <Route path="/" element={<Start />}>
            <Route path="/beer" element={<Beer />} />
          </Route>
    </Routes>
  );
}

export default App;
